import React, { useState, useEffect } from "react";
import Box from "./Box";
import "./Container.css";
import AA from "./AA/AA";
import MFI from "./MFI/MFI";
import Pagination from "../Pagination/Pagination";
import Plant from "./Plant/Plant";
import { Plants } from "../../Services/Json";

function Container(prop) {
    const [currentPage, setCurrentPage] = useState(1);
    const itemsPerPage = 2;
    const [timeIn, setTimeIn] = useState(5000);
    const [plantData, setPlantsData] = useState([]);
    const [currentPlantIndex, setCurrentPlantIndex] = useState(0);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await Plants();
                if (response.length > 0) setPlantsData(response);
            } catch (error) {
                console.error(error);
            }
        };

        fetchData();
    }, []);

    useEffect(() => {
        const totalPages = Math.ceil(plantData[currentPlantIndex].machineGroups.length / itemsPerPage);
        const interval = setInterval(() => {
            if (currentPage === totalPages) {
                const nextPlantIndex = (currentPlantIndex + 1) % plantData.length;
                setCurrentPlantIndex(nextPlantIndex);
            } else {
                setCurrentPage((prevPage) => prevPage + 1);
            }
        }, timeIn);

        return () => clearInterval(interval);
    }, [itemsPerPage, plantData, currentPlantIndex, currentPage, timeIn]);

    const handlePageChange = (pageNumber) => {
        // No need to update the current page index
    };

    const indexOfLastItem = currentPage * itemsPerPage;
    const indexOfFirstItem = indexOfLastItem - itemsPerPage;
    const currentItems = plantData[currentPlantIndex].machineGroups.slice(indexOfFirstItem, indexOfLastItem);

    return (
        <div>
            <div className="PlantName">{plantData[currentPlantIndex].name}</div>
            <div className="wholeContainer">
                <div className="container">
                    <Plant currentItems={currentItems} />
                </div>
                <div className="seccon">
                    <div className="AA">
                        <AA />
                    </div>
                    <div className="MFI">
                        <MFI />
                    </div>
                </div>
            </div>
            <div className="footer1">
                <div className="Pagination">
                    <div className="Footer1-item"> Zoom in/out </div>
                    <div className="Footer1-item">
                        <Pagination
                            items={plantData[currentPlantIndex].machineGroups}
                            currentPage={currentPage}
                            itemsPerPage={itemsPerPage}
                            onPageChange={handlePageChange}
                        />
                    </div>
                    <div className="Footer1-item" style={{ textAlign: "center" }}>
                        <input onClick={handleCheck} type="checkbox" />
                        <label>Stop AutoPagination</label>
                    </div>
                </div>
            </div>
            <div className="footer2">
                <div className="indicator1">
                    <div className="circle1" style={{ background: "rgb(100, 221, 23)" }}></div>
                    <div className="author1">
                        <p>Health Score &gt; 80%</p>
                    </div>
                    <div className="circle1" style={{ background: "rgb(255, 193, 7)" }}></div>
                    <div className="author1">
                        <p>Health Score &gt; 50% &lt; 80%</p>
                    </div>
                    <div className="circle1" style={{ background: "rgb(255, 87, 34)" }}></div>
                    <div className="author1">
                        <p>Health Score &lt; 50%</p>
                    </div>
                    <div className="circle1" style={{ border: "solid 1px black" }}></div>
                    <div className="author1">
                        <p>Health Score Not Available</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Container;
